### expected behaviour
i wanto to open the trash in the webinterface and delete all files.
in the folder on the server are 8800 files in /owncloud/data/davidak/files_trashbin/files

### actual behaviour
takes multiple minutes to load the site, sometimes chrome say that the page not react anymore and want to close it.

### steps to reproduce
1. have 8800 files in trash, some of them broken
2. load trash in browser
3. ???
4. wait about 2-5 minutes
5. you can select all and delete them, what takes more minutes that a normal user don't wait ... but its deleted succesfully! :)

### solution
don't display all files at once.
maybe load more content if scroll to the bottom or multiple pages.
this function can be used in file browser and contacts too, where i have the same problem with lots of files (more than 2.000).

### server configuration
owncloud version: 5.0.4 (updated from 5.0.3 and 5.0)

operating system: ubuntu-server 12.04

web server: apache2

database: mysql

php version: 5.3.10-1ubuntu3.6

### client configuration
browser: chrome

operating system: win 7

